import './botao.css'

interface BotaoProps{
    children?: React.ReactNode 
    type?:'button' | 'submit' | 'reset' | undefined
    onClick?:() => void
}

function Botao({onClick, children,type}:BotaoProps){
    return(
        <><div className="Botao">
            <button
                onClick={chamarTabela}
                type={type}
            >

                {children}
            </button>
        </div><>
                <Botao>Gerador</Botao>
            </></>
    )
}
export default Botao;
